function ProductDetail(){
    const params = useParams()
   

    return (
    <>
    <h1>Product Details</h1>
    <p>{params.productId}
    </p>
    ".." goes back to root level because ProductDetails is a child of 
    <p><Link to="..">Back</Link></p>
    </>)
}

export default ProductDetail
